window.bookSummaryJSON = "<p><b>Who will live?</b></p> <p><b>Who will die?</b></p> <p><b>Who will be changed...forever?</b></p> <p>Separated from the Evanderians, Ayleth finds herself alone in the malevolent Witchwood.</p> <p>Or perhaps not entirely alone....</p> <p>Confronted with the reality of her living grandmother, Ayleth soon learns that the horrors once ascribed to Dread Odile's name and legend may not be entirely true. But what is the truth? Could the infamous Witch Queen be a freedom fighter providing hope for those oppressed under Saint Evander's law? Is she the loving family Ayleth thought she'd lost forever? Or is she the greatest threat the world has ever known?</p> <p>While battling to save their loved ones, Ayleth, Terryn, and Gerard must each face the lies that have influenced their lives since childhood. The final battle is upon them, and the decisions they make will shape the course of destiny.</p>"; 
